class Form extends React.Component {
    render() {
        return (
            <div className="container" style={styles.formContainer}>
                <div className="input-group mb-3">
                    <input type="text" className="form-control" placeholder="Description ex: Java, Ruby, Javascript" aria-label="Username" aria-describedby="basic-addon1" />
                </div>
                <div className="input-group mb-3">
                    <input type="text" className="form-control" placeholder="City Name or Zipcode" aria-label="Username" aria-describedby="basic-addon1" />
                </div>
            </div>


        );
    };

};

const styles = {
    formContainer: {
        padding: '10px',
        border: '1px solid black'
    },
    cityInput: {
        width: '60%'
    }

}


export default Form;
